import React, { FunctionComponent, useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import Logo from '../components/logo-grid';
import Skin from '../models/skin';
import SkinCard from '../components/skin-card';
import voidskin from '../models/void-skin';
import SkinDetail from '../components/skin-detail';
import getSkinsList from '../api-request/skin/get-list';

const Home: FunctionComponent = () => {


    const [detailskin, setDetailskin] = useState(voidskin);
    const [skinteam, setSkinteam] = useState([voidskin]);


    const updateskins = ()  => {
        getSkinsList.then(result => { setSkinteam(result[0]) });
    }

    const team: any = []
    skinteam.forEach(skin => {
        if (skin._id === "644ea7dd085fce53b1a010b8" || skin._id === "21" || skin._id === "25" || skin._id === "17") {
            team.push(skin)
            console.log()
        }
    })

    const openDetail = (skinfrom: Skin) => {
        setDetailskin(skinfrom)
    }

    const [test, setTest] = useState(0);
    useEffect( () => {
        getSkinsList.then(result => { console.log(result[0]) });
    }, [test])

    const incr = (test:number) => {
        setTest(test +1)
    }



    return (

        <div>
            <div className='home pl50 pr50 flex-col relative flex-center-x'>
                <div className='home__pres relative w100 flex-col flex-center pt50'>
                    <div className='home__pres__logo-bg absolute zi0'>
                        <Logo sizeblocs={3} hover={false} />
                    </div>
                    <div className="home__pres__container flex-center flex-col zi1 g25 g5-tab">
                        <h1 className='m0 txt-center-tab w45 blue w100-tab'>
                            <Link to='/user-profile'>Dr No Problem</Link>
                        </h1>
                        <div onClick={() => incr(test)}>test</div>
                        <div className="flex-around flex-center-tab flex-col-tab flex-row">
                            <div className="home__pres__container__title flex-center-tab flex-col flex-end-x flex-row-tab g15-tab mb25-tab mt15-tab txt-end w30 w90-tab">
                                <p className='home__pres__container__title__sub m0'>aka</p>
                                <h2 className='home__pres__container__title__main m0 red'><Link to='/user-profile'>Max Le Roux</Link></h2>
                                <h2 className='home__pres__container__title__main-sub m0 red' style={{ color: "#ff2768bf" }}>
                                    <Link to='/user-profile'>Doc Le Roux</Link></h2>
                                <h2 className='home__pres__container__title__main-sub m0 red' style={{ color: "#ff276880" }}>
                                    <Link to='/user-profile'>Aerouxaar</Link></h2>
                                <h2 className='home__pres__container__title__main-sub m0 red' style={{ color: "#ff276840" }}>
                                    <Link to='/user-profile'>ZumbyX8</Link></h2>
                            </div>
                            <div className="home__pres__container__content flex-center-y flex-col h100 w100-tab w60">
                                <p className='m0 fs20'>Je suis un développeur web junior passionné de jeux vidéo et d'art.</p>
                                <p className='m0 fs20'>J'aime combiner mes passions pour créer des projets créatifs et interactifs.</p>
                                <p className='m0 fs20'>Toujours en quête de nouvelles compétences et technologies, je suis ouvert aux opportunités pour explorer ce domaine passionnant.</p>
                            </div>
                        </div>
                    </div>
                </div>



                <div className="home__skin-list flex-col w60 mlrauto">
                    <h1 className='home__skin-list__team__title w100 mt50 relative'>Team skin :</h1>
                    <ul className='home__skin-list__container flex-wrap w100-tab w100 g15 pt15 pb15 flex-around relative'>
                        {team.map((skin: Skin) => (

                            <SkinCard
                                key={skin._id}
                                skin={skin}
                                exept={['']}
                                clickcard={openDetail}
                                update={updateskins}
                            />

                        ))}
                    </ul>
                    <Link to={"/skins"} className='mb15'>
                        <div className="cta">
                            <span>See all skins</span>
                        </div>
                    </Link>

                </div>

                <div className="home__contact flex-col w60 w100-tab mlrauto">
                    <h1 className='home__contact__title w100 mt50 relative'>Contacts :</h1>
                    <div className="home__contact__container flex-row g25 p50 pt15 mb15 p0-tab">

                        <a href='https://www.twitch.tv/dr_no_problem' className='home__contact__container__tile' target='new_blank'>
                            <div className="cta cta-twitch external">
                                <span>Twitch</span>
                            </div>
                        </a>

                        <a href='/' className='home__contact__container__tile' target='new_blank'>
                            <div className="cta cta-discord external">
                                <span>Discord</span>
                            </div>
                        </a>

                        <a href='/' className='home__contact__container__tile' target='new_blank'>
                            <div className="cta cta-twitter external">
                                <span>Twitter</span>
                            </div>
                        </a>
                    </div>

                </div>


            </div>
            {detailskin.classe !== "no-display" ? (
                <SkinDetail
                    skin={detailskin}
                    clickcard={openDetail}
                    update={updateskins}
                />
            ) : null}
        </div>
    )
}

export default Home;
